import Navbar from "./components/Navbar";
import FooterComponent from "./components/Footer";

function ContactUs(){
    return(
        <div>
            <Navbar/>
            <h1 className="text-center mt-5">Contact Us Page</h1>
            <FooterComponent/>
        </div>
    )
}

export default ContactUs;
